script: |
  super -f text -I q757.spq | sort > q757.out

inputs:
  - name: q757.spq
    data: |
      SELECT DISTINCT COUNT ( * ) FROM tab0 (FORMAT parquet) WHERE NOT - + col1 * + col2 - + - col1 BETWEEN + + col1 * + 95 AND ( + col0 );
  - name: tab0

outputs:
  - name: q757.out
    data: |
      3
